        function pop_Zonalespartidos_1(feature, layer) {

                mouseout: function(e) {

                        layer.eachLayer(function(feature){
                            feature.closePopup()
                        });
                    }
                },
                mouseover: highlightFeature,
            });
            var popupContent = '<table>\
                    <tr>\
                        <td colspan="2">' + (feature.properties['fna'] !== null ? autolinker.link(feature.properties['fna'].toLocaleString()) : '') + '</td>\
                    </tr>\
                    <tr>\
                        <td colspan="2">' + (feature.properties['Zonal'] !== null ? autolinker.link(feature.properties['Zonal'].toLocaleString()) : '') + '</td>\
